import React from "react";
import styles from "./NumberList.module.css";
import { generate } from "shortid";

const NumberList = ({ list }) => {
  const AddNewNumber = list.map((item) => {
    const { number } = item;
    return (
      <li key={generate()} className={styles.Item}>
        {number}
      </li>
    );
  });
  return <ul>{AddNewNumber}</ul>;
};

export default NumberList;
